"use strict";import FormulaProcessor from"../FormulaProcessor.js";function SUM(args,table){const values=FormulaProcessor.getArgumentsValues(args,table);let result=0;for(let i=0,iEnd=values.length,value;i<iEnd;++i){value=values[i];switch(typeof value){case"number":if(!isNaN(value)){result+=value}break;case"object":result+=SUM(value,table);break}}return result}FormulaProcessor.registerProcessorFunction("SUM",SUM);export default SUM;